import React, {Component} from "react";

class AddUser extends Component{
    state={name:"",email:""};
    render(){
        return(
            <div className="card">
                <h4 className="card-header">Add New User</h4>
                <div className="card-body">
                    <form>
                        <div className="form-group">
                            <label htmlFor="name">Name</label>
                            <input type={"name"} name="name" id="name" placeholder="Enter Name" className="form-control" value={name}/>
                        </div>
                        <div className="form-group">
                            <label htmlFor="email">Email</label>
                            <input type={"email"} name="email" id="email" placeholder="Enter Email" className="form-control" value={email}/>
                        </div>
                        <button type="submit" className="btn btn-danger btn-block">Add New User</button>
                    </form>
                </div>
            </div>
        );
    }
}
export default AddUser;
